Patch Set 2:

While reviewing this, I naturally wondered why we should allow the list to receive a list of tablet IDs rather than force users to provide the list using a shell script loop. Then I looked at what you had written in KUDU-3070 and saw that you had began with that, but the repeated cost of opening an FsManager was causing the overall operation to be very expensive.

How about this as an alternative: let's make it possible to open an FsManager _without opening a BlockManager_. There are many CLI tools that don't manipulate data blocks and could use this alternate open mode to speed up their operations. But by opening the FsManager and DataDirManager, we continue to enforce that read-write operations must lock the directories first, preventing consistency issues if run alongside a running tserver/master.

To make this work, we'd need to skip the following lines of code in fs_manager.cc:

  // Finally, initialize and open the block manager.
  InitBlockManager();
  LOG_TIMING(INFO, "opening block manager") {
    RETURN_NOT_OK(block_manager_->Open(report));
  }

We'd also need to make sure that the returned FsReport makes sense, and also that the various FsManager methods that invoke or return the BlockManager DCHECK that it exists first. Then we can start rolling out this alternate open mode for whichever CLI tools could safely use it.

What do you think?

Patch Set 10:

(2 comments)

It's frustrating that C++ doesn't offer a way to pass an exclusively owned object (i.e. unique_ptr<Foo>) into a std::bind call and store the result in an std::function. I tried the following code, but it doesn't compile:

  void TakesOwnership(std::unique_ptr<Foo> arg) {}

  auto f = std::make_unique<Foo>();
  // f becomes null during the following call.
  auto cb = std::bind(&TakesOwnership, std::move(f));

The closest thing to this is C++14 lambda capture semantics, which allow capture-by-move. In this case, you could capture-by-move the deleter into a lambda which invokes DeleteTablet, then submit that lambda as a functor to the threadpool. But, we don't support C++14 yet. :/

If you prefer, you can adapt OpenTablet to use gutil/callback.h-style functors, which will allow you to wrap the deleter in a kudu::Passed() wrapper and, in OpenTablet, "unwrap" it into a gscoped_ptr. But given that we've been trying to move away from gscoped_ptr usage, maybe that's a step in the wrong direction.
